import React from 'react';
import {FormularioAdmin} from './FormularioAdmin';
import { HomeSuper } from '../pages/HomeSuper';
import {Routes, Route, useNavigate, Outlet} from 'react-router-dom';
import { useRoutes } from 'react-router-dom';

export function HomeSuperadmin({user, setUser}) {
  const navigate = useNavigate();

  const handleLogout = () => {
    setUser(null); // Set user to null when logging out
    navigate('/login'); // Redirect to login page
  };

  let element = useRoutes([
    { path: '/', element: <HomeSuperadmin /> },
    { path: 'registrar', element: <FormularioAdmin /> },
  ]);

  return element ? element : (
    <div>
      <h1>Bienvenido</h1>
      <h2>{user && user.nombre}</h2>

      <button onClick={() => navigate('registrar')}>Registrar</button>
      <button onClick={handleLogout}>Cerrar sesi√≥n</button>
    </div>
  );
}
